(18, 4, 'ECS000018', '夏新T5', '+', 0, 0, 0, '', 1, '0.000', '3453.60', '2878.00', '0.00', 0, 0, 1, '2008年04月 3G(GSM,900,1800,1900,TD-SCDMA ) 直板 262144万 320×240 像素 是 银色', '', '<p>&nbsp;  TD-SCDMA/GSM两种模式任意切换，中国3G手机先驱，支持大陆特有3G网络，轻松实现可视电话、视频留言、视频会议功能，2.6英寸Q屏，手写、键盘双输入，内置移动证券，支持手机邮箱、手机地图、无驱U盘</p>', '', '', '', 1, '', 1, 1, 0, 28, 1241969533, 100, 1, 0, 0, 0, 0, 0, 1241969533, 2, '', -1, -1, 0, 0, '', 0, 0, '', '', 0),
(19, 31, 'ECS000019', '兰蔻精华眼膜霜15ml', '+', 47, 0, 1, '', 12, '0.000', '560.00', '429.00', '0.00', 0, 0, 1, '滑盖 GSM 258 时尚 蓝牙 黑色 金色 白色', '改善眼部基底和眼周围肌肤状况，立现名晰动人的双眸，明亮新生！', '<p>从整体来看，三星SGH-F258比较<font size="3" color="#ff0000"><strong>时尚</strong></font>可爱，三围尺寸为94&times;46&times;17.5mm，重量为96克，曲线柔和具有玲珑美感。</p>\r\n<p>&nbsp;</p>\r\n<p>三星F258的前面板整体应用<strong><font size="3" color="#ff0000">镜面效果</font></strong>，2.0英寸显示屏幕略显窄小，导航键与功能键在滑盖滑开之前是前面板的全部控制键，没有挂断和接听键，不过，五向键有<font size="3"><strong><font color="#ff0000">音乐操</font><font color="#ff0000">作</font></strong></font>功能，明确显示了F258音乐手机的定位。</p>\r\n<p>&nbsp;</p>\r\n<p>F258的数字键键区采用了极具金属质感的平板式设计，每颗按键的面积足够大，按键与按键之间的间隔明显，操作起来手感舒适。</p>', 'images/201311/thumb_img/19_thumb_G_1384994159077.gif', 'images/201311/goods_img/19_G_1384994159884.jpg', 'images/201311/source_img/19_G_1384994159117.jpg', 1, '', 1, 1, 0, 4, 1241970139, 2, 0, 0, 0, 0, 0, 0, 1446429442, 9, '', -1, -1, 0, 0, '', 3, 0, '', '', 0),
(20, 3, 'ECS000020', '纪梵希幻影四宫格胭脂21#7g', '+', 34, 0, 21, '', 12, '0.000', '430.00', '259.00', '0.00', 0, 0, 1, 'GSM 直板 40和弦 金属材质 2008年07月 黑色 GSM,900,1800,1900,2100', '浅粉蜜桃色，柔玫瑰粉红，带少许珠光的蜜桃橘。打造水蜜桃甜滋滋的感觉。', '', 'images/201311/thumb_img/20_thumb_G_1384994312013.gif', 'images/201311/goods_img/20_G_1384994312529.jpg', 'images/201311/source_img/20_G_1384994312118.jpg', 1, '', 1, 1, 0, 2, 1241970417, 100, 0, 0, 0, 0, 0, 0, 1446429443, 9, '', -1, -1, 0, 0, '', 0, 0, '', '', 0),
(21, 47, 'ECS000021', '蜜丝佛陀纤柔眼线液1#0.75ml', '+', 40, 0, 10, '', 40, '0.000', '98.00', '75.00', '0.00', 0, 0, 1, '2008年03月 GSM,900,1800,1900,2100 直板 1600万 240×400 像素 2007年12月 200万摄像头 黑色', '', '<p>&nbsp;</p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">标准配置: 标准锂电池两块,充电器两个,立体声耳机一个,数据线,说明书送256TF</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">通讯功能&nbsp; 输入法 短信功能 话机通讯录 通话记录</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">输入法: 中文输入法</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">短信功能: 支持短信300条和彩信100条</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">话机通讯录: 1000组名片式电话存储 来电防火墙功能&nbsp; 来电大头贴及来电铃声识别</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">通话记录：支持电话录音,恢复/静音,双音多频,免提</font></span></p>\r\n<p>&nbsp;</p>\r\n<p><font size="3">高级功能</font></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">多媒体娱乐: 200万像素，最大支持10240*960，11级数码变焦,多种效果设置,连拍可全屏查看拍摄或下载的图片.支持有声MP4短片拍摄，录像时间根据内存 大小而定，拍摄录像,TV电视可跟朋友家人一起分享。支持网络摄像头功能 支持MPEG4、3GP(H.263)等视频格式 支持MP3等音频格式播放， 支持歌词播放</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">内置游戏:智能拼图</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">扩展存储功能:支持TF扩展,支持U盘功能,本机内置1M,随机赠送256TF卡</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">高级功能:直板/智能PDA手写/键盘输入 超长待机 WAP上网&nbsp; 录音 蓝牙 FM收音机 电子书 Java扩展 TV电视输出 声控语音拨号 免费电视 来电防火墙&nbsp;&nbsp;&nbsp;</font></span></p>\r\n<p align="left"><span style="font-size: medium;"><font size="3">附加功能: 日历 计算器 闹钟 记事本 日程表 秒表 单位换算</font></span></p>\r\n<p><span style="font-size: medium;"><font size="3">提醒 以上性能均为本公司员工试机后所写,产品资料仅供参考,请以收到实物为准</font></span></p>', 'images/201311/thumb_img/21_thumb_G_1385075715191.jpg', 'images/201311/goods_img/21_G_1385075715772.jpg', 'images/201311/source_img/21_G_1385075715028.png', 1, '', 1, 1, 